import axios from 'axios';
import React, { useEffect } from 'react'

export default function Home() {
    const [data, setData] = useState(null);

    useEffect(() => {
        axios
            .get('http://localhost:8000/')
            .then((actualData) => {
                setData(actualData.data);
            })
            .catch((err) => {
                console.log(err);
            })
    })

  return (
    <div>
      <h1>Data</h1>
      <ul>
          {data &&
          data.map((item, i) => {
              return (
                  <div key={i}>
                      <p>{item.title}</p>
                  </div>
              )
          })}
      </ul>
    </div>
  )
}
